import React from 'react';

function Card({card, onCardClick}) {

  function handleClick () {
    onCardClick(card);
};

  return (
    <article className="place">
      <img alt={card.card.name} className="place__image" src={card.link} onClick={handleClick} />
      <div className="place__info">
        <h2 className="place__name">{card.card.name}</h2>
        <div className="place__reaction">
          <button type="button" className="place__like" aria-label="Нравится"></button>
          <span className="place__like-count">{card.card.likes.length}</span>
        </div>
      </div>
      <button type="button" className="place__delete" arial-label="Удалить"></button>
    </article>
  );
}

export default Card;
